script: |
  super -f text -I q6591.spq | sort > q6591.out

inputs:
  - name: q6591.spq
    data: |
      SELECT ALL + 61 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 6 * ( - col2 ) BETWEEN - col1 + - + col1 / col0 AND + - 3;
  - name: tab2

outputs:
  - name: q6591.out
    data: |
      61
      61
      61
